// src/Home.js
import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h1>Welcome to the Chatbot App</h1>
      <p>Choose a chatbot or create a new source:</p>
      <ul>
        <li>
          <Link to="/public">Public Chatbot</Link>
        </li>
        <li>
          <Link to="/internal">Internal Chatbot</Link>
        </li>
        <li>
          <Link to="/create-source">Create a New Source</Link> {/* Add this link */}
        </li>
      </ul>
    </div>
  );
}

export default Home;
